'use strict';
const { createFarm } = require('../routes/services/create-farm');

const createFarms = async (userId) => {
  const farm1 = await createFarm(
    userId, 'Terreno 1', 'Irrigation',
    'data:image/jpeg;base64,',
    true, 1010.5, true
  );
  const farm2 = await createFarm(
    userId, 'Terreno 2', 'DryLand',
    'data:image/jpeg;base64,',
    true, 1010.5, true
  );

  return { farm1, farm2 };
};


module.exports = {
  createFarms
};
